import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <Link to="/" style={styles.link}>
        Home
      </Link>
      <Link to="/admin" style={styles.link}>
        Admin
      </Link>
    </nav>
  );
};

export default Navbar;
